import React from 'react';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography'

import { requestFiveDayPrediction } from "../weatherAPI";
import Prediction from './Prediction';
import '../styles.css';

class MultiplePredictions extends React.Component {

  generateData() {
    var predictions_list = [];
    var multiple_forcast = requestFiveDayPrediction(this.props.code);
    console.log(multiple_forcast);
    if (this.multiple_forcast) {
      predictions_list = multiple_forcast.DailyForecasts.map((daily_data, index) => {
        return <Prediction data={daily_data} key={index}/>;
      })
    }
    return predictions_list;
  }

  render() {
    console.log(this.props);
    const multiple_forcast = requestFiveDayPrediction(this.props.code).then((response) => { return response.Headline });
    console.log(multiple_forcast);
    return(
      <div>
        <Grid container spacing={2}>
          <Typography>
            TExt
          </Typography>
          <Grid item xs={12}>
            <Grid container justify="space-around">
              {[0, 1, 2, 3, 4].map(value => (
                <Grid key={value} item>
                  <Paper className="paper"/>
                  <Typography>
                    {multiple_forcast === undefined ? "true" : "false"}
                  </Typography>
                </Grid>
              ))}
            </Grid>
          </Grid>
        </Grid>
      </div>
    );
  }
}

export default MultiplePredictions;
